//App.js
import React from "react";
import Login from "./components/Login";
import Salir from "./components/Salir";
import Home from "./components/Home";
import Usuarios from "./components/Usuarios";
import Libros from "./components/Libros";
import NavDropdown from 'react-bootstrap/NavDropdown';
import {
    BrowserRouter as Router,
    Route,
    Link,
    Routes,
    Outlet,
} from "react-router-dom";
import { Navbar, Nav,Footer } from "react-bootstrap";

function NotFound() {
    return (
        <div>
            <h2>No se pudo encontrar la pagina</h2>
            <p>Lo sentimos la pagina web que esta tratando de cargar no existe.</p>
        </div>
    );
}

function get_nombre() {
    let nombre = (localStorage.getItem('nombre'));
    return nombre;
}

function get_profile() {
    try {
        if (get_nombre() == null) {
            return (
                <Nav.Link as={Link} to="/Login">
                    Iniciar session
                </Nav.Link>
            );
        } else {
            if (get_nombre().length < 1) {

                return (
                    <Nav.Link as={Link} to="/Login">
                        Iniciar session
                    </Nav.Link>
                );
            } else if (localStorage.getItem('privilegio') == '1') {
                return (
                    <NavDropdown title="Menu del usuario" id="basic-nav-dropdown">
                        <p className="text-center"> {get_nombre()}</p>
                        <NavDropdown.Divider />
                        <Nav.Link as={Link} to="/Usuarios">
                            Usuarios
                        </Nav.Link>
                        <Nav.Link as={Link} to="/Libros">
                            Libros
                        </Nav.Link>
                        <NavDropdown.Divider />
                        <Nav.Link as={Link} to="/Salir">
                            Salir
                        </Nav.Link>
                    </NavDropdown>
                );
            } else if (localStorage.getItem('privilegio') == '2') {
                return (
                    <NavDropdown title="Menu del usuario" id="basic-nav-dropdown">
                        <p className="text-center"> {get_nombre()}</p>
                        <NavDropdown.Divider />
                        <Nav.Link as={Link} to="/Libros">
                            Libros
                        </Nav.Link>
                        <NavDropdown.Divider />
                        <Nav.Link as={Link} to="/Salir">
                            Salir
                        </Nav.Link>
                    </NavDropdown>
                );
            }
        }
    } catch (error) {

    }
}

function App() {

    return (
        <Router>
            <Navbar bg="light" expand="lg">
                <Navbar.Brand>
                    <h1 className="ml-3" style={{ color: "green" }}>LibroWiki</h1>
                </Navbar.Brand>

                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto">
                        <Nav.Link as={Link} to="/Home" exact>
                            Inicio
                        </Nav.Link>
                        {get_profile()}
                    </Nav>

                </Navbar.Collapse>
            </Navbar>
            <Footer className="bg-body-tertiary">

                    <Navbar.Brand href="#home">Navbar with text</Navbar.Brand>
                    <Navbar.Toggle />
                    <Navbar.Collapse className="justify-content-end">
                        <Navbar.Text>
                            Signed in as: <a href="#login">Mark Otto</a>
                        </Navbar.Text>
                    </Navbar.Collapse>

            </Footer>
            <div className="container mt-4">
                <Routes>
                    <Route path="/" element={<Outlet />}>
                        <Route path="/Home" element={<Home />} />
                        <Route path="/Salir" element={<Salir />} />
                        <Route path="/Libros" element={<Libros />} />
                        <Route path="/Usuarios" element={<Usuarios />} />
                        <Route path="/Login" element={<Login />} />
                        <Route path="*" element={<NotFound />} />
                    </Route>
                </Routes>
            </div>
        </Router>

    );

}
export default App;
